import React from "react";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow">
      <div>
        <h1>
          Soccer<span>Info</span>
        </h1>
      </div>
      <div>
        <li>Leagues</li>
        <li>World Cup</li>
        <li>Transfers</li>
      </div>
    </div>
  );
};

export default Navbar;
